syntax = "editions";

package geostore;

import "geostore/base/proto/options.proto";
import "google/api/inclusion.proto";

option java_multiple_files = true;
option java_package = "com.google.geostore.base.proto";

message VehicleOccupancyRangeProto {
    optional int32 min_occupancy = 1;
    optional int32 max_occupancy = 2;
}
